import * as React from "react";
import PropTypes from "prop-types";
import SwipeableViews from "react-swipeable-views";
import { useTheme } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import ProductItem from "./ProductItem";
import { Grid } from "@mui/material";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    "aria-controls": `full-width-tabpanel-${index}`,
  };
}

export default function FullWidthTabs() {
  const theme = useTheme();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChangeIndex = (index) => {
    setValue(index);
  };

  return (
    <Box sx={{ bgcolor: "background.paper" }}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="secondary"
          textColor="inherit"
          variant="fullWidth"
          aria-label="full width tabs example"
        >
          <Tab label="Desktop" {...a11yProps(0)} />
          <Tab label="Laptop" {...a11yProps(1)} />
          <Tab label="" {...a11yProps(2)} />
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === "rtl" ? "x-reverse" : "x"}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
          <Grid
            container
            spacing={3}
            display="flex"
            justifyContent="space-between"
          >
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 1"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 2"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 3"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 4"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 5"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <ProductItem
                itemImg="https://images.unsplash.com/photo-1541363111435-5c1b7d867904?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                itemName="Item 6"
                itemDescription="Lorem Ipmus ranging across all continents except Antarctica  ranging across all continents except Antarctica  ranging across all continents except Antarctica"
              />
            </Grid>
          </Grid>
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
          Item Two
        </TabPanel>
        <TabPanel value={value} index={2} dir={theme.direction}>
          Item Three
        </TabPanel>
      </SwipeableViews>
    </Box>
  );
}
